import React from 'react';
import '../../assets/style/HistoryFilters.css';

const FilterSection = () => {
    const starOptions = [2, 3, 4, 5, 6]; 
    
    return (
        <div className="filter-section">
            <div className="filter-buttons">
                <button className="filter-button">Times</button>
                <button className="filter-button">Stops</button>
                <button className="filter-button">Airlines</button>
                <button className="filter-button">Airports</button>
                <button className="filter-button">Amenities</button>
                <button className="edit-search-button">
                    Edit Search
                    <div className='dropdown-arrow'></div>
                </button>
            </div>
            <div className="star-rating-section">
                {starOptions.map(starCount => (
                    <div key={starCount} className="star-group">
                        {[...Array(3)].map((_, index) => (
                            <div key={index} className="star-rating">
                                {[...Array(starCount)].map((_, starIndex) => (
                                    <span key={starIndex} className="star">&#9733;</span>
                                ))}
                                {[...Array(6 - starCount)].map((_, emptyStarIndex) => (
                                    <span key={emptyStarIndex} className="star empty">&#9734;</span>
                                ))}
                            </div>
                        ))}
                    </div>
                ))}
            </div>

        </div>
    );
};

export default FilterSection;
